import axios from 'axios';

async function mongodbRetrieve(playerType) {
    const requestObj = {
        'playerType': playerType
    }
    const response = await axios.get('http://localhost:5000/mongodb-players/retrieve', requestObj);
    console.log(response);
}

export default mongodbRetrieve;
